(1,	1,	'2025-08-04 14:26:35',	'2025-08-04 10:56:35',	'فرش ایرانی به دلیل کیفیت فوق العاده ای که دارد، معمولا از قیمت نسبتا بالایی هم برخوردار است. گرچه قیمت آن در برابر کیفیت و زیبایی و زحمت هنرمندان قالی باف ایرانی بسیار ناچیز است.\r\n\r\nفرش های دستباف ایرانی از دیرباز در جهان شهره عام و خاص بوده اند و این فرش ها زیبا و فوق العاده از مهمترین سوغاتی های ایران به ویژه در میان گردشگران خارجی به شمار می روند.\r\n\r\nعلاوه بر فرش های دستباف، محصولات مرتبطی هم مانند قالیچه، گلیم و گبه هم در خانواده فرش ایرانی قرار دارند و در مناطق مختلف کشور بافته شده و به عنوان یکی از مرسوم ترین سوغاتی های ایران در بازار به فروش می رسند. گلیم و گبه نسبت به فرش دستباف قیمت مناسب تری داشته و در زیبایی و جذابیت نیز دست کمی از فرش های دستبافت ایرانی ندارند، حمل و نقل آنها نیز برای گردشگران بسیار آسان تر است.',	'معروف ترین سوغاتی های ایران',	'',	'publish',	'open',	'open',	'',	'%d9%85%d8%b9%d8%b1%d9%88%d9%81-%d8%aa%d8%b1%db%8c%d9%86-%d8%b3%d9%88%d8%ba%d8%a7%d8%aa%db%8c-%d9%87%d8%a7%db%8c-%d8%a7%db%8c%d8%b1%d8%a7%d9%86',	'',	'',	'2025-09-07 13:22:30',	'2025-09-07 09:52:30',	'',	0,	'http://base.local/?p=1',	0,	'post',	'',	1),
