(99,	1,	'2025-08-20 14:25:26',	'2025-08-20 10:55:26',	'<p>فرش ایرانی به دلیل کیفیت فوق العاده ای که دارد، معمولا از قیمت نسبتا بالایی هم برخوردار است. گرچه قیمت آن در برابر کیفیت و زیبایی و زحمت هنرمندان قالی باف ایرانی بسیار ناچیز است.</p>\n<p>فرش های دستباف ایرانی از دیرباز در جهان شهره عام و خاص بوده اند و این فرش ها زیبا و فوق العاده از مهمترین سوغاتی های ایران به ویژه در میان گردشگران خارجی به شمار می روند.</p>\n<p>علاوه بر فرش های دستباف، محصولات مرتبطی هم مانند قالیچه، گلیم و گبه هم در خانواده فرش ایرانی قرار دارند و در مناطق مختلف کشور بافته شده و به عنوان یکی از مرسوم ترین سوغاتی های ایران در بازار به فروش می رسند. گلیم و گبه نسبت به فرش دستباف قیمت مناسب تری داشته و در زیبایی و جذابیت نیز دست کمی از فرش های دستبافت ایرانی ندارند، حمل و نقل آنها نیز برای گردشگران بسیار آسان تر است.</p>',	'معروف ترین سوغاتی های ایران',	'',	'inherit',	'closed',	'closed',	'',	'1-autosave-v1',	'',	'',	'2025-08-20 14:25:26',	'2025-08-20 10:55:26',	'',	1,	'https://base.local/?p=99',	0,	'revision',	'',	0),
